import React from "react";
import "./Button.css";

interface ButtonProps {
  title: string;
  type: string;
  action: (genre: string) => void;
}
export const Button = ({ title, type, action }: ButtonProps) => {

    const onButtonClick = (genre: string) => {
        action(genre);
    }

  return (
    <button onClick={() => onButtonClick(genre)} className={`button__${type}`}>
      {title}
    </button>
  );
};
